// You can manually add your sentences and questions here
export const studyData = [
  {
    complexityLevel: 1,
    sentenceId: "sentence_1",
    sentence: "The cat that the dog chased meowed.",
    questions: [
      {
        id: 1,
        type: "action_performed",
        difficulty: "easy",
        entity: "cat",
        question: "What did the cat do?",
        correctAnswer: "meowed"
      },
      {
        id: 2,
        type: "agent_identification",
        difficulty: "easy",
        entity: "dog",
        question: "What did the dog chase?",
        correctAnswer: "the cat"
      },
      {
        id: 3,
        type: "entity_count",
        difficulty: "medium",
        entity: "all",
        question: "How many distinct entities are in the sentence?",
        correctAnswer: "2"
      },
      {
        id: 4,
        type: "nested_dependency",
        difficulty: "medium",
        entity: "cat",
        question: "What did the entity that was chased do?",
        correctAnswer: "meowed"
      },
      {
        id: 5,
        type: "causal_sequence",
        difficulty: "hard",
        entity: "cat",
        question: "What series of events led to the cat's action?",
        correctAnswer: "the dog chasing the cat"
      },
      {
        id: 6,
        type: "chain_consequence",
        difficulty: "hard",
        entity: "dog",
        question: "What is the consequence of the dog's involvement?",
        correctAnswer: "the cat meowed"
      }
    ]
  }
  // Add more complexity levels here following the same structure
];
